import React from "react";
import styled from "styled-components";

const Main = styled.div`
    background: green;
    height: 100%;
    width: 20%;
    padding: 0 20px;
`;

const Title = styled.div`
    height: 20%;
    width: 100%;
    P{
        font-size: 30px;
    }
`;

const List = styled.div`
    height: 70%;
    width: 100%;
    background: aqua;
`;

const Item = styled.div`
    background: red;
    border-bottom: 2px solid grey;
    display: flex;
    justify-content: flex-start;
    align-items: center;
    height: 25%;
    width: 100%;
    ul{
        display: flex;
        align-items: center;
        p1{
            font-size: 20px;
            color: blue;
            font-weight: bold;
        }
    }
`;

export default function index() {
    return (
        <Main>
            <Title><p>LINKS</p></Title>
            <List>
                <Item>
                    <ul>
                    <p1>1.</p1>
                    <p2>Lorem ipsum dolor sit amet</p2>
                    </ul>
                </Item>
            </List>
        </Main>
    )
}
